// j-th largest element in O(n) time with custom partitioning k

const int jthLargest(std::vector<int> & A, const size_t & j, const size_t & k, const size_t & begin, const size_t & end){
    int m = 0;
    if (end - begin <= k){
        sort(A.begin()+begin, A.begin()+end);
        m = A[(begin+end)/2];
    }
    else{
        const size_t n = (end - begin + k - 1)/k; // ceil
        std::vector<int> p(n);
        for (size_t i = 0; i < n; i++){
            sort(A.begin() + begin + i*k, std::min(A.begin() + end, A.begin() + begin + (i+1)*k));
            p[i] = A[(begin + i*k + std::min(end, begin + (i+1)*k))/2];
        }
        m = jthLargest(p, p.size()/2, k, 0, p.size());
    }
    size_t l = begin, r = end-1;
    while (l < r){
        if (A[l] >= m)
            std::swap(A[l], A[r--]);
        else
            l++;
    }
    if(A[r] < m)
        r++;
    if (j == end - r)
        return m;
    else if (j < end - r)
        return jthLargest(A, j, k, r, end);
    else
        return jthLargest(A, j - (end - r), k, begin, r);
}

int manual_test(std::vector<int> & A, const size_t & j){
    sort(A.begin(), A.end());
    return A[A.size()-j];
}




